import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import HomePage from './pages/HomePage';

function App() {

  return (
    <Router>
        <Switch>
          <Route path="/" component={<HomePage />}>
            <About />
          </Route>
        </Switch>
    </Router>
  );
}

export default App;
